import React from 'react';
import pricing from '../../assets/pricing.png';
const Pricing = () => {
    return (
        <div id="pricing">
            <p className="sectionHeader" class='pricing'>Pricing</p>
            <p className='pricingSlogan'>An investment in a better wine experience. </p>
            {/* Improve your wine experience for just 33 cents a day. */}
            <p id="pricingCost">$9.<sup>99</sup></p>


            <img id="pricingImage" src={pricing}/>
            {/* Illustration by <a href="https://icons8.com/illustrations/author/602b6fa7123f993a3afdba7b">  Victoria Chepkasova</a> from <a href="https://icons8.com/illustrations">Ouch!</a> */}
      </div>
    );
};

export default Pricing;
